pattern = [0, 1, 0, -1]
signal = list(map(int, list(input())))
for phase in range(100):
	output_signal = []

	for i in range(len(signal)):
		idx = 1
		new_pattern = [x for x in pattern for y in range(i+1)]
		result = 0
		for val in signal:			
			result += (val * new_pattern[idx])
			idx = (idx+1) % len(new_pattern)
		output_signal += [int(str(result)[-1])]

	signal = output_signal

print('Part 1', ''.join(map(str, output_signal[:8])))